import React from 'react'

function Nav({handleCampaignType}){

    return(
        <nav className="navBar">
            <a href="#" onClick={(e)=>{e.preventDefault() ; handleCampaignType(1)}} >Upcoming Campaings</a>
            <a href="#" onClick={(e)=>{e.preventDefault() ; handleCampaignType(0)}}>Live Campaigns</a>
            <a href="#" onClick={(e)=>{e.preventDefault() ; handleCampaignType(-1)}}>Past Campaings</a>
        </nav>
    )
}

export default Nav ;
